from django.urls import path, re_pathfrom drf_yasg import openapifrom drf_yasg.views import get_schema_viewfrom rest_framework import permissionsfrom rest_framework_simplejwt.views import (    TokenObtainPairView,    TokenRefreshView,)from . import viewsschema_view = get_schema_view(    openapi.Info(        title="API docs",        default_version='v2.0',        description="API for dating app",        terms_of_service="https://www.google.com/policies/terms/",        contact=openapi.Contact(email="contact@snippets.local"),        license=openapi.License(name="BSD License"),    ),    public=True,    permission_classes=[permissions.AllowAny],)urlpatterns = [    path('list/', views.UserViewSet.as_view({'get': 'list'})),    path('clients/<int:id>/match/', views.LikeViewSet.as_view({'post': 'create', })),    path('clients/create/', views.UserViewSet.as_view({'post': 'create', })),    path('token/refresh/', TokenRefreshView.as_view(), name='token_refresh'),    path('token/', TokenObtainPairView.as_view(), name='token_obtain_pair'),    re_path(r'^swagger(?P<format>\.json|\.yaml)$', schema_view.without_ui(cache_timeout=0), name='schema-json'),    re_path(r'^swagger/$', schema_view.with_ui('swagger', cache_timeout=0), name='schema-swagger-ui'),    re_path(r'^redoc/$', schema_view.with_ui('redoc', cache_timeout=0), name='schema-redoc'),]